import { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: 'Linda',
          id: '12e123131'
        },
        {
          name: 'frank',
          id: '12e129131'
        },
        {
          name: 'linda',
          id: '12e126131'
      },
      {
        name: 'Troy',
        id: '12e123121'
    }
      ]
  };
  }

  render(){
  return (
    <div className="App">
      {
        this.state.monsters.map((monster) => {
          return <h1 key={monster.id}>{monster.name}</h1>
        })
      }
    </div>
  );
}
}

export default App;
